import styles from './styles.module.css'
import dataGlasses from '../Data/dataGlasses.json';

export default class TryGlassesOn extends Component {
  renderGlassList = ()=>{
    return dataGlasses.map((glassesItem, iundex)=>{
      return glassesItem.name
    })
  }

  render() {
    const styleGlasses = {
      width: '150px',
      top: '66px',
      right: '69px',
      opacity: '0.8'
    }

    const infoGlasses = {
      width: '250px',
      top: '200px',
      left: '270px',
      paddingLeft: '15px',
      backgroundColor: 'rgba(255,127,0,.5)',
      textAlign: 'left',
      height: '105px'
    }

    
    return (
      <div style={{ backgroundImage: 'url(./glassesImage/background.jpg)', backgroundSize: '2000px', minHeight: '2000px' }}>

      </div >
  )
  }
}
